"use strict";

const ObjectStoreError = require("./objectstore-error.js");

class LockDoesNotExist extends ObjectStoreError {
  constructor(cause, message) {
    super(message || "Lock of uuObject does not exist.", cause);
    this.code = `${ObjectStoreError.ERROR_PREFIX}lockDoesNotExist`;
  }
}

module.exports = LockDoesNotExist;
